There is no `#` Printf flag for a string verb:

> 	# alternate format: add leading 0 for octal (%#o), 0x for hex (%#x);
	0X for hex (%#X); suppress 0x for %p (%#p);
	for %q, print a raw (backquoted) string if strconv.CanBackquote
	returns true;

What you are doing is therefore equivalent to `fmt.Printf("%s", Point{1, 2, 3})` as there are no flags as Vet points out.
